import React from 'react';

function Footer() {
  return (
    <footer style={styles.footer}>
      <p>© 2025 Turističke Ture. Sva prava zadržana.</p>
    </footer>
  );
}

const styles = {
  footer: {
    marginTop: '50px',
    padding: '20px',
    backgroundColor: '#f1f1f1',
    textAlign: 'center',
    color: '#555',
  },
};

export default Footer;
